import logo from './logo.svg';
import './App.css';

function App() {
  return (
      <div className="w-screen h-screen flex flex-col items-center justify-center bg-gray-100 p-4">
          <div className="bg-white rounded-2xl shadow-md w-full max-w-sm p-6">
              <h1 className="text-xl font-bold text-center mb-4">모바일 전용 앱</h1>
              <p className="text-gray-600 text-center">PC에서는 제한된 UI</p>
              <button
                  className="mt-4 w-full bg-blue-500 text-white py-2 rounded-xl hover:bg-blue-600 active:bg-blue-700">
                  시작하기
              </button>
          </div>
      </div>
  );
}

export default App;
